import '../Estilos/Home.css'

class Home extends Component {
    render() {
        return (    
            <div class="container">    
            <div class="card">
            <div class="card-body">
                <h1 class="card-title">¿Qué se te antoja hoy?</h1>
                <p class="card-text">With supporting text below as a natural lead-in to additional content.</p>
            </div>
            </div>
            </div> 

        )
    }
}

export default Home;
